        <div className='flex space-x-4 text-black p-2 sm:px-12 py-4 rounded-md sm:rounded-xl bg-gray-100 relative w-full sm:w-3/4 xl:w-2/5 mx-auto mb-6 bg-gray-100'>
            <Skeleton circle width={40} height={40}/>
            <div className= 'items-center'>
                <Skeleton width={90} height={20}/>
               <Skeleton width={90} height={20}/>
            </div>
        </div>

    </div>
  )
}

